// Figma : Section 1

import logo from './logo.svg'
import wave from './wave.svg'
import './cover.css'

function Section1(){
return(
    <div className='cover-image'>
    <div className='overlay'></div>
    <div className='logo'>
        <img src={logo} alt='Logo'></img>
        <p className='logo-text'>travelio</p>
    </div>
    <span className='one-liner'><p className='one-liner'>Connecting <span className='blue-text'>travellers</span> across the globe</p></span>
    <img className='wave' src={wave} alt='Wave'></img>
</div>
)
}


export default Section1;
